/** @format */

import React from 'react';
import { Switch, Route } from 'react-router-dom';
import CollectionOverview from '../../components/collectionOverview/collection-item-Overview.component';
import CollectionBySection from '../../components/collection-by-section/collection-by-section.component';

const Shop = (props) => {
	const { match } = props;
	return (
		<>
			<Switch>
				<Route exact path={`${match.path}`} component={CollectionOverview} />
				<Route path='/shop/:categoryId' component={CollectionBySection} />
			</Switch>
		</>
	);
};

export default Shop;
